import axios from "axios"
import { getapi } from "../constant"

const getResource = async()=>{
  let resp="";  
   await axios.get(getapi).then(res =>{
      if(res.status==200){
        resp = json(res.data.imgData);
      }

  });
  return resp;

}
export default getResource;
